rk well with sites that use caching.'=>'Password Protected no siempre funciona bien con sitios que usan caché.','W3 Total Cache'=>'W3 Total Cache','WP Engine Hosting'=>'Alojamiento en WP Engine','A very simple way to quickly password protect your WordPress site with a single password. Please note: This plugin does not restrict access to uploaded files and images and does not work with some caching setups.'=>'Un modo muy sencillo de proteger por contraseña rápidamente tu sitio WordPress con una simple contraseña. A tener en cuenta: Este plugin no restringe el acceso a los archivos e imágenes subidos y no funcionará en WP Engine o con algunas configuraciones de cache.','https://wordpress.org/plugins/password-protected/'=>'https://es.wordpress.org/plugins/password-protected/','Log In'=>'Acceder','Remember Me'=>'Recuérdame','Password'=>'Contraseña','<strong>ERROR</strong>: Cookies are blocked or not supported by your browser. You must <a href=\'http://www.google.com/cookies.html\'>enable cookies</a> to use WordPress.'=>'<strong>ERROR</strong>: Las Cookies están bloqueadas o no son compatibles con tu navegador. Debes <a href=\'http://www.google.com/cookies.html\'>activar las cookies</a> para usar WordPress.','Logout'=>'Salir','Incorrect Password'=>'Contraseña incorrecta','Feeds are not available for this site. Please visit the <a href="%s">website</a>.'=>'Los feeds no están activos en este sitio. Por favor, visita <a href="%s">la web</a>.','You have enabled password protection and allowed logged in users - other users will still need to enter a password to view the site.'=>'Has activado la protección por contraseña y permitido el acceso usuarios registrados. El resto de usuarios tendrá que introducir la contraseña para ver el sitio.','You have enabled password protection and allowed administrators - other users will still need to enter a password to view the site.'=>'Has activado la protección por contraseña y permitido el acceso a administradores. El resto de usuarios t